import React from 'react';

import '../styles/left-side.css';

export default function LeftSide() {
    return (
        <div className="left-side">
            <div className="numbers">
                <p>1</p>
                <p>2</p>
                <p>3</p>
                <p>4</p>
                <p>5</p>
                <p>6</p>
                <p>7</p>
                <p>8</p>
            </div>
        </div>
    );
};
